import React from 'react';
// import Card from './Card';

const App = () => {
  const numbers = [1, 4, 6, 8, 45, 89];
  const lis = numbers.map((number) => {
    '<li>' + (number + 1) + '</li>';
  });
  return (
    <>
      <ul>{lis}</ul>
    </>
  );
};
export default App;
